apiVersion: machineconfiguration.openshift.io/v1
kind: MachineConfig
metadata:
  labels:
    machineconfiguration.openshift.io/role: worker
  name: 99-worker-ca-trustlist
spec:
  config:
    ignition:
      version: 3.2.0
    storage:
      files:
      - path: /etc/pki/ca-trust/source/blacklist/HellenicAcademicandResearchInstitutionsRootCA2011
        contents:
          source: data:text/plain;charset=utf-8;base64,
        mode: 0644
        overwrite: true
      - path: /etc/pki/ca-trust/source/blacklist/HellenicAcademicandResearchInstitutionsECCRootCA2015
        contents:
          source: data:text/plain;charset=utf-8;base64,
        mode: 0644
        overwrite: true
      - path: /etc/pki/ca-trust/source/blacklist/HellenicAcademicandResearchInstitutionsRootCA2015
        contents:
          source: data:text/plain;charset=utf-8;base64,
        mode: 0644
        overwrite: true
      - path: /etc/pki/ca-trust/source/anchors/naverica1.crt
        contents:
          source: data:text/plain;charset=utf-8;base64,
        mode: 0644
        overwrite: true
      - path: /etc/pki/ca-trust/source/anchors/naverrca1.crt
        contents:
          source: data:text/plain;charset=utf-8;base64,
        mode: 0644
        overwrite: true
